import React from "react";
import Clock from './ClockComponent/Clock'


class Home extends React.Component {

    //Calling BackEnd api
    constructor(props){
        super(props)

        this.state = { apiResponse : "" }
    }

    stscalendar = {
        name: "",
        dayOfWeek: ""
    }

    callAPI(){
        fetch("http://localhost:8080/home")
            .then(res => res.text())
            .then(res => res.this.setState({apiResponse: res}))
            .catch(err => err)


    }

    componentDidMount(){
        this.callAPI()
    }


    render() {
        return(
            <div>
                <Clock/>
                <span>{this.state.apiResponse}</span>
            </div>
        )
    }
}

export default Home;
